var title_f0_19_316="Immunosuppressive rx infections";
var content_f0_19_316=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F53524&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F53524&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Infections associated with specific immunosuppressive regimens",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Antilymphocyte globulins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T-cell depleting antibodies - activation of latent (herpes) viruses, fever, cytokine release",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Glucocorticoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bacteria, Pneumocystis pneumonia, activation of hepatitis C and hepatitis B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Azathioprine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neutropenia, possible role in human papillomavirus infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Mycophenolate mofetil",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early bacterial infection B-cell depression, possible role in late-onset CMV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cyclosporine/tacrolimus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased viral replication, B-cell depression, gingival infection, intracellular pathogens",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Rapamycin (sirolimus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excess infections in combination with current agents, idiosyncratic pulmonary syndrome, often with concomitant respiratory pathogens",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Plasmapheresis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Encapsulated bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Costimulatory blockade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unknown so far (possible role in post-transplant lymphoproliferative disorder [PTLD])",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Rituximab",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B-cell depletion, bacterial and viral infections",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
