var title_f0_19_317="Increasing plasma cholesterol and coronary risk";
var content_f0_19_317=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60146&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60146&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Association of increasing plasma cholesterol and coronary risk",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 364px; height: 238px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relation between plasma cholesterol concentration and six-year coronary heart disease risk in 361,662 men (ages 35 to 57) screened during the MRFIT study. There is a continuous, positive, graded correlation between the plasma cholesterol concentration and coronary risk. To convert plasma cholesterol to mmol/L, divide by 38.5.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Stamler J, Wentworth D, Neaton JD. JAMA 1986; 256:2823.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
