var title_f0_19_318="Valvular regurgitation dexfen";
var content_f0_19_318=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57538&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57538&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 515px\">",
"   <div class=\"ttl\">",
"    Prevalence of aortic regurgitation is increased with dexfenfluramine",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 495px; height: 269px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among 223 patients treated with dexfenfluramine (Dexfen) there is an increase in the presence of 2+ aortic regurgitation (AR) (6.3 versus 1.6 percent for control, p&lt;0.02*) and any degree of AR (21.5 versus 11 percent, p = 0.005&bull;). Additionally, there is a significant increase in any FDA-grade regurgitation of either the aortic or mitral valve in the dexfenfluramine patients (7.6 versus 2 percent, p = 0.01&Delta;).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Shively, BK, Roldan, CA, Gill, EA, et al, Circulation 1999; 100:2161.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
